import { Component } from '@angular/core';
import { MenuItem } from './app.interfaces';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'ExerciseTracker';

  usersMenu: MenuItem[] = [];
  exercisesMenu: MenuItem[] = [];
}
